import React from 'react';
import Enzyme, { shallow } from 'enzyme';
import Adapter from 'enzyme-adapter-react-15';

import DrawingsDetail from '../DrawingsDetail/DrawingsDetail';
import { valuesNames, valuesLabels } from '../forms.config';
import { getDDMMMYYYY } from '../../../../utils/time-helpers.utils';

Enzyme.configure({ adapter: new Adapter() });

const propsForDrawingPanel = {
  detail: {
    [valuesNames.AUTHOR]: 'bob.smith@gmail.com',
    [valuesNames.DATE_CREATED]: 1514215345123,
    [valuesNames.DATE_UPDATED]: 1514215570852,
    [valuesNames.DRAWING]: 'data:image/png;base64,',
    [valuesNames.NAME]: 'winter is coming',
    [valuesNames.SOURCE]: 'qewdDB',
    [valuesNames.SOURCE_ID]: '34ca9074-9220-4bbb-8215-d5d999eeda03',
    [valuesNames.USER_ID]: 9999999000,
  },
};

const DRAWING = 'drawing';
const DRAWING_PANEL = 'drawingPanel';
const CONVERT_DATE_CREATED = getDDMMMYYYY(propsForDrawingPanel.detail[valuesNames.DATE_CREATED]);

describe('Component <DrawingsDetail />', () => {
  it('should renders with props correctly', () => {
    const component = shallow(<DrawingsDetail />);

    // Testing component when detail filled object, expandedPanel is all, and panel not edited
    component.setProps({ detail: propsForDrawingPanel.detail, expandedPanel: 'all', editedPanel: { [DRAWING]: false } });
    expect(component.props().className).toEqual('section-detail');
    expect(component.find('PluginDetailPanel')).toHaveLength(2);

    // Testing drawing
    expect(component.find('PluginDetailPanel').at(0).props().name).toEqual(DRAWING);
    expect(component.find('PluginDetailPanel').at(0).props().title).toEqual('Drawing');
    expect(component.find('PluginDetailPanel').at(0).props().isOpen).toEqual(false);
    expect(component.find('PluginDetailPanel').at(0).props().isBtnShowPanel).toEqual(true);
    expect(component.find('PluginDetailPanel').at(0).props().isShowControlPanel).toEqual(true);

    expect(component.find('.drawing-wrapper')).toHaveLength(1);
    expect(component.find('.drawing-canvas-holder')).toHaveLength(1);
    expect(component.find('img').prop('src')).toEqual(propsForDrawingPanel.detail[valuesNames.DRAWING]);

    // Testing drawingPanel
    expect(component.find('PluginDetailPanel').at(1).props().name).toEqual(DRAWING_PANEL);
    expect(component.find('PluginDetailPanel').at(1).props().title).toEqual('Drawing Details');
    expect(component.find('PluginDetailPanel').at(1).props().isOpen).toEqual(false);
    expect(component.find('PluginDetailPanel').at(1).props().isBtnShowPanel).toEqual(true);
    expect(component.find('PluginDetailPanel').at(1).props().isShowControlPanel).toEqual(true);

    expect(component.find('.control-label').at(0).text()).toEqual(valuesLabels.NAME);
    expect(component.find('.control-label').at(1).text()).toEqual(valuesLabels.SOURCE);
    expect(component.find('.control-label').at(2).text()).toEqual(valuesLabels.AUTHOR);
    expect(component.find('.control-label').at(3).text()).toEqual(valuesLabels.DATE_CREATED);

    expect(component.find('.form-control-static').at(0).text()).toEqual(propsForDrawingPanel.detail[valuesNames.NAME]);
    expect(component.find('.form-control-static').at(1).text()).toEqual(propsForDrawingPanel.detail[valuesNames.SOURCE]);
    expect(component.find('.form-control-static').at(2).text()).toEqual(propsForDrawingPanel.detail[valuesNames.AUTHOR]);
    expect(component.find('.form-control-static').at(3).text()).toEqual(CONVERT_DATE_CREATED);

    expect(component).toMatchSnapshot();
  });

  it('should renders correctly with different state of props', () => {
    const component = shallow(
      <DrawingsDetail />);
    // Testing component when detail empty object, expandedPanel is drawing
    component.setProps({ detail: {}, expandedPanel: DRAWING, editedPanel: { [DRAWING]: false } });
    expect(component.find('PluginDetailPanel')).toHaveLength(1);
    expect(component.find('PluginDetailPanel').props().name).toEqual(DRAWING);
    expect(component).toMatchSnapshot();

    // Testing component when detail empty object, expandedPanel is drawingPanel
    component.setProps({ detail: { [valuesNames.DATE_CREATED]: 1507020019000, [valuesNames.DATE_UPDATED]: 1511568000000 }, expandedPanel: DRAWING_PANEL });
    expect(component.find('PluginDetailPanel')).toHaveLength(1);
    expect(component.find('PluginDetailPanel').props().name).toEqual(DRAWING_PANEL);
    expect(component).toMatchSnapshot();

    // Testing component when detail filled object, expandedPanel is all, and DRAWING panel is edited
    component.setProps({ detail: propsForDrawingPanel.detail, expandedPanel: DRAWING, editedPanel: { [DRAWING]: true } });
    expect(component.find('DrawingsPaint')).toHaveLength(1);
    expect(component.find('PluginDetailPanel').props().name).toEqual(DRAWING);
    expect(component).toMatchSnapshot();

    // Testing component when detail filled object, expandedPanel is all, and DRAWING_PANEL panel is edited
    component.setProps({ detail: propsForDrawingPanel.detail, expandedPanel: DRAWING_PANEL, editedPanel: { [DRAWING_PANEL]: true } });
    expect(component.find('ReduxForm')).toHaveLength(1);
    expect(component.find('PluginDetailPanel').props().name).toEqual(DRAWING_PANEL);
    expect(component).toMatchSnapshot();
  });
});

